USE db_merchant;

CREATE TABLE `lox2` (
  `log_id` varchar(255) collate utf8_unicode_ci default NULL,
  `log_name` varchar(255) collate utf8_unicode_ci default NULL,
  `log_user_id` varchar(255) collate utf8_unicode_ci default NULL,
  `log_session` varchar(255) collate utf8_unicode_ci default NULL,
  `log_message` varchar(255) collate utf8_unicode_ci default NULL,
  `log_stamp` timestamp NOT NULL default CURRENT_TIMESTAMP on update CURRENT_TIMESTAMP
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;


